import React, { useEffect, useState } from "react";
import { Table, Row, Container } from "react-bootstrap";
import "./App.css";

import { Router, Route, Switch } from "react-router-dom";
import UsersList from "./Components/UsersList";

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/">
          <UsersList />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
